DROP TABLE IF EXISTS `xmw_advancedtable`;
CREATE TABLE `xmw_advancedtable`  (
  `BugID` int NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `title` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT 'Bug标题',
  `type` varchar(10) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT 'Bug类型\r\n1、功能优化\r\n2、界面优化\r\n3、数据异常\r\n4、代码错误\r\n5、配置相关\r\n6、安装部署\r\n7、安全相关\r\n8、性能问题\r\n9、标准规范\r\n10、测试脚本\r\n11、设计缺陷\r\n12、其他\r\n\r\n\r\n',
  `degree` varchar(10) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '严重程度\r\n1、致命\r\n2、严重\r\n3、一般\r\n4、轻微',
  `priority` varchar(10) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT 'Bug优先级\r\nP0、紧急\r\nP1、高\r\nP2、中\r\nP3、低',
  `state` varchar(10) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT 'Bug状态\r\n1、已解决\r\n2、进行中\r\n3、未解决\r\n4、已关闭',
  `progress` int NOT NULL COMMENT 'Bug解决进度',
  `designated` int NOT NULL COMMENT '指派给谁，对应用户UserID',
  `creator` int NOT NULL COMMENT '创建人，对应用户UserID',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  `endTime` datetime NOT NULL COMMENT '截止日期',
  PRIMARY KEY (`BugID`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 21 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci ROW_FORMAT = COMPACT;

